%let lastindx = &amp;SQLOBS;

data _null_;
  set work.profile;
  call symput(&quot;t&quot;||strip(2-_n_),compress(outcome));
run;

proc sql;
   select mean(%EM_BINARY_TARGET) into :rho1
   from &amp;EM_IMPORT_DATA;
quit;

%let pi1=&amp;rho1;

%let pf11=%sysevalf(1/&amp;pi1);  %let pf10=0;
%let pf01=0;                  %let pf00=%sysevalf(1/(1-&amp;pi1));

%macro assess(data=,inputcount=,best=,inputsinmodel=);

proc sort data=work.scored&amp;data;
  by descending p_&amp;t1 ;
run;

data work.assess;
  attrib DATAROLE length=$5;
  retain sse 0 csum 0 DATAROLE &quot;&amp;data&quot;;

  array n[0:1,0:1] _temporary_ (0 0 0 0);
  array w[0:1] _temporary_ (1 1);
  keep DATAROLE INPUT_COUNT BEST TOTAL_PROFIT KS ASE C;

  set work.scored&amp;data end=last;

  ap_&amp;t1=w[1]*p_&amp;t1/(w[1]*p_&amp;t1+w[0]*p_&amp;t0);
  ap_&amp;t0=1-ap_&amp;t1;

  d1=&amp;pf11*ap_&amp;t1+&amp;PF01*ap_&amp;t0;
  d0=&amp;pf10*ap_&amp;t1+&amp;PF00*ap_&amp;t0;

  t=(strip(%EM_BINARY_TARGET)=&quot;&amp;t1&quot;);
  d=(d1&gt;d0);

  n[t,d] + w[t];
  sse + (%EM_BINARY_TARGET-p_&amp;t1)**2;
  csum + ((n[1,1]+n[1,0])*(1-t)*w[0]);

  if last then do;
    INPUT_COUNT=&amp;inputcount;
	BEST=&amp;best;
    TOTAL_PROFIT = sum(&amp;PF11*n[1,1],&amp;PF10*n[1,0],&amp;PF01*n[0,1],&amp;PF00*n[0,0]);
    KS = -1 + TOTAL_PROFIT/sum(n[0,0],n[1,0],n[0,1],n[1,1]);
    ASE = sse/sum(n[0,0],n[1,0],n[0,1],n[1,1]);
    C = csum/(sum(n[0,0],n[0,1])*sum(n[1,0],n[1,1]));
    output;
  end;
run;

proc append base=&amp;EM_USER_ASSESS data=work.assess;
run;

%mend;


%macro fitandscore();
proc datasets library=%scan(&amp;EM_USER_ASSESS,1,.) nodetails nolist;
  delete %scan(&amp;EM_USER_ASSESS,2,.);
run;

%let ic=;

%do model_indx=1 %to &amp;lastindx;

%let im=&amp;&amp;inputs&amp;model_indx;
%if %nlist(&amp;im)=&amp;ic %then %let bc=%eval(&amp;bc+1);
%else %let bc=1;
%let ic=%nlist(&amp;im);

data _null_;
  attrib s length=$100;
  file PRINT;
  put &quot;***********************************************;&quot;;
  put &quot;*  Inputs in model: &amp;ic;&quot;;
  put &quot;*             Best: &amp;bc;&quot;;
  put &quot;***********************************************;&quot;;
  put;
  put '%let varlist=  ' @;
  put &quot;%upcase(%scan(&amp;im,1))&quot;;
  %do ii=2 %to %nlist(&amp;im);
  put @16 &quot;%upcase(%scan(&amp;im,&amp;ii))&quot;;
  %end;
  put ';';
  put '%let varlist=%enquote(&amp;varlist,separator=);';
  s='%metadata(newrole=Rejected,where=upcase(NAME) not in (&amp;varlist) and upcase(ROLE)='||&quot;'INPUT');&quot;;
  put s;
  put 'run;';
run;

proc logistic data=&amp;EM_IMPORT_DATA des namelen=200;
  model %EM_BINARY_TARGET=&amp;im;
  score data=&amp;EM_IMPORT_VALIDATE
        out=work.scoredvalid(keep=%EM_BINARY_TARGET p_&amp;t1 p_&amp;t0);
run;

%assess(data=VALID,inputcount=&amp;ic, best=&amp;bc, inputsinmodel=&amp;im);

%end;
%mend;

