----------------------------------------------------------------------------------------------------------------------------------*/
%LET VARLIST= &amp;SIGNIFICANT.;

%LET VARLIST=%ENQUOTE(&amp;VARLIST.,SEPARATOR=);
%METADATA(NEWROLE=REJECTED,WHERE=NAME NOT IN (&amp;VARLIST.) AND UPCASE(ROLE)='INPUT');

