%macro m_collinearity_analysis
(
INPUTS=
,target=
,lib=
,ds=
,vif=
,Load=
,partition_col=
,partition_val=
,mdl=
,GenerateOutput=
,log_printto=
,output_printto=
)
;
%Let timeStart = %Sysfunc(Datetime());
/*------------------------------------------------------------------------------
  --- Start opt sas Parameters
  ------------------------------------------------------------------------------*/
dm log &quot;clear&quot; continue;/*clear current log*/
dm 'ODSRESULTS' CLEAR;/*Clear current results*/
%if %upcase(&amp;Generateoutput)=N %then
     %do;
           /*options nosymbolgen nomprint nomlogic;*//*Set no code debugging*/
           proc printto
                file=&quot;&amp;output_printto&quot;
                log=&quot;&amp;log_printto&quot;
                new;
           run;
           ods results off;/*Stop saving html results*/
           ods output close;/*Stop generating output*/
           ods html close; /*Stop generating html results*/
           /*ods listing close;/*stop saving results to listing*/
     %end;
/*****************|Clear working directory|************/
/*proc datasets lib=work nolist kill mt=data;
run;*/
/*------------------------------------------------------------------------------
       --- Declare global Collinearity free storage variable
------------------------------------------------------------------------------*/
%global collin_free_inputs;
/*------------------------------------------------------------------------------
       --- Check for partition
------------------------------------------------------------------------------*/
%let vpart=;
%if %length(&amp;partition_col)&gt;0 %then
     %let vpart=%str(where &amp;partition_col = &quot;&amp;partition_val&quot; ;);
/*------------------------------------------------------------------------------------------
--|Step1: Generate the initial collinearity diagnostics
------------------------------------------------------------------------------------------*/
PROC CONTENTS
           DATA=&amp;DS.
           OUT=VARIABLES_NAMES;
RUN;

PROC SQL;
	CREATE TABLE NAMES(NAME CHAR(200));
QUIT;

%let nd=%sysfunc(countw(&amp;INPUTS.));
%let quote_inputs=;
			%do i1=1 %to &amp;nd %by 1;
				%let var = %scan(&amp;INPUTS,&amp;i1,' ');
				PROC SQL;
					INSERT INTO NAMES VALUES(&quot;&amp;var&quot;);
				QUIT;
/*
				%let var = %scan(&amp;INPUTS,&amp;i1,' ');
				%let quote_inputs=%str(&amp;quote_inputs. &quot;&amp;var&quot;);	*/
			%end;

PROC SQL;
     CREATE TABLE VARIABLES_INPUTS
     AS
     SELECT
     DISTINCT NAME
     FROM VARIABLES_NAMES
     WHERE NAME IN (select name from names)
     ;
QUIT;

PROC REG
           DATA=&amp;DS
           plots(maxpoints=none)
           ;
     &amp;vpart
     model &amp;target=&amp;INPUT/collin vif tol;
     ODS OUTPUT
     PARAMETERESTIMATES=PE_REG
     ;
run;

/*------------------------------------------------------------------------------------------
--|Step0: Delete variables that are linear function of other variables
------------------------------------------------------------------------------------------*/
PROC SQL NOPRINT;
	DELETE FROM VARIABLES_INPUTS WHERE COMPRESS(NAME) IN (SELECT COMPRESS(VARIABLE) FROM PE_REG WHERE ESTIMATE=0);

	SELECT
	COMPRESS(NAME)
	INTO
	:NEW_INPUTS SEPARATED BY &quot; &quot;
	FROM VARIABLES_INPUTS
	;
QUIT;
%LET inputs=&amp;NEW_INPUTS.;
/*------------------------------------------------------------------------------------------
--|Step0: rerun regression free of linear functions and create collinearity statistics
------------------------------------------------------------------------------------------*/
PROC REG
           DATA=&amp;DS
           plots(maxpoints=none)
           ;
     &amp;vpart
     model &amp;target=&amp;INPUTS/collin vif tol;
     ODS OUTPUT
     CollinDiag=CD_REG
     PARAMETERESTIMATES=PE_REG
     ;
run;

/*------------------------------------------------------------------------------------------
--|Step1: Check if the present model has collinearity issues
------------------------------------------------------------------------------------------*/
TITLE 'Initial Number of conflicts';
PROC SQL;
SELECT
COUNT(DISTINCT VARIABLE) INTO :Conflicts
FROM PE_REG
WHERE
     VARIANCEINFLATION&gt;=&amp;vif
;
QUIT;

%let n=0;

%if &amp;Conflicts.=0 %then
     %let collin_free_inputs=&amp;inputs;
/*------------------------------------------------------------------------------------------
--|Step1: If that so, initiate loop
------------------------------------------------------------------------------------------*/
%let k=0;
%do %while(&amp;Conflicts&gt;0);
     /*------------------------------------------------------------------------------------------
     --|Step1: Get the most conflicting variavle
     ------------------------------------------------------------------------------------------*/
     TITLE &quot;The first dominant variable and its VIF&quot;;
     PROC SQL;
           SELECT
           COMPRESS(variable)
           ,VARIANCEINFLATION
           INTO
           :FIRST_DOMINANT
           ,:FIRST_VIF
           FROM PE_REG
           having
                VARIANCEINFLATION=max(VARIANCEINFLATION)
           ;
     QUIT;
     /*------------------------------------------------------------------------------------------
     --|Step1: Get the maximum loading for this variable and its component (dimension)
     ------------------------------------------------------------------------------------------*/
     TITLE &quot;Maximum dimension for the first dominant variable&quot;;
     PROC SQL;
           SELECT
           STRIP(put(number,9.)) INTO :MAXDIM
           FROM CD_REG
           having
                &amp;FIRST_DOMINANT=max(&amp;FIRST_DOMINANT)
           ;
     QUIT;
     TITLE &quot;Loading for the first dominant&quot;;
     PROC SQL;
           SELECT
           max(&amp;FIRST_DOMINANT) INTO :FIRST_Loading
           FROM CD_REG
           ;
     QUIT;
     /*------------------------------------------------------------------------------------------
     --|Step4: Transpose the collinearity diagnostics
     ------------------------------------------------------------------------------------------*/
     PROC TRANSPOSE
           DATA=CD_REG
           OUT=CD_REG_T (DROP=_LABEL_)
           PREFIX=component
           NAME=INT_VARIABLE
     ;
           VAR
                &amp;INPUTS
                ;
     run;
     /*------------------------------------------------------------------------------------------
     --|Step1: Get the second greatest loading for that component
     ------------------------------------------------------------------------------------------*/
     TITLE &quot;The second dominant variable for the &amp;MAXDIM component&quot;;
     PROC SQL;
           SELECT
           COMPRESS(INT_VARIABLE) INTO :Second_Dominant
           FROM CD_REG_T
           WHERE
                INT_VARIABLE ne &quot;&amp;FIRST_DOMINANT&quot;
           HAVING COMPONENT&amp;MAXDIM=MAX(COMPONENT&amp;MAXDIM)
           ;
     QUIT;
     /*------------------------------------------------------------------------------------------
     --|Step1: Get the VIF for the second dominant variable
     ------------------------------------------------------------------------------------------*/
     TITLE &quot;VIF for the second dominant variable&quot;;
     PROC SQL;
           SELECT
           VARIANCEINFLATION
           INTO
           :second_VIF
           FROM PE_REG
           where  variable=&quot;&amp;Second_Dominant&quot;
           ;
     QUIT;
     TITLE &quot;Loading for the second dominant variable for the component &amp;MAXDIM&quot;;
     PROC SQL;
           SELECT
           MAX(COMPONENT&amp;MAXDIM) INTO :Second_LOADING
           FROM CD_REG_T
           WHERE
                INT_VARIABLE ne &quot;&amp;FIRST_DOMINANT&quot;
           ;
     QUIT;
     %IF &amp;FIRST_LOADING&gt;&amp;SECOND_LOADING %THEN
           %LET REJECT=&amp;Second_Dominant;
     %ELSE
           %LET REJECT=&amp;FIRST_Dominant;
         /*------------------------------------------------------------------------------------------
     --|Step7: Get rid off the conflicting variable
     ------------------------------------------------------------------------------------------*/
     PROC SQL;
         DELETE FROM VARIABLES_INPUTS WHERE COMPRESS(NAME)=COMPRESS(&quot;&amp;REJECT.&quot;);
         DELETE FROM VARIABLES_INPUTS WHERE COMPRESS(NAME) IN (SELECT COMPRESS(VARIABLE) FROM PE_REG WHERE ESTIMATE=0);

         SELECT
           COMPRESS(NAME)
           INTO
           :new_inputs SEPARATED BY &quot; &quot;
           FROM VARIABLES_INPUTS
           ;
     QUIT;
     %let inputs=&amp;new_inputs;
/*   %let inputs = %sysfunc(tranwrd(&amp;inputs,&amp;Reject_validated.,));*/
     /*------------------------------------------------------------------------------------------
     --|Step2: Run the linear regression and generate the collinearity diagnostics
     ------------------------------------------------------------------------------------------*/
     PROC REG
                DATA=&amp;DS
                plots(maxpoints=none)
                ;
           &amp;vpart
           model &amp;target=&amp;INPUTS/collin vif tol;
           ODS OUTPUT
           CollinDiag=CD_REG
           PARAMETERESTIMATES=PE_REG
           ;
     run;
     /*------------------------------------------------------------------------------------------
     --|Step1: Check if collinearity is still present
     ------------------------------------------------------------------------------------------*/
     TITLE 'Variables with conllinearity issues';
     PROC SQL;
     SELECT
     COUNT(DISTINCT VARIABLE) INTO :Conflicts
     FROM PE_REG
     WHERE
           VARIANCEINFLATION&gt;=&amp;VIF.
     ;
     QUIT;

     title;

     %let n=%eval(&amp;n+1);
	  %let k=%eval(&amp;k+1);
%end;

/*---------------------------------------------------------------------------------------------------------------------------------
--|Save results to desire location|--
----------------------------------------------------------------------------------------------------------------------------------*/
PROC SQL;
   CREATE TABLE &amp;em_lib..Collinearity_Results_&amp;mdl.
 	as
   SELECT
	*
   FROM PE_REG
   ;
QUIT;

PROC SQL;
   SELECT
	VARIABLE
	INTO
	:inputs SEPARATED BY &quot; &quot;
   FROM PE_REG
   WHERE VARIANCEINFLATION&lt;&amp;VIF. AND VARIANCEINFLATION IS NOT NULL
   ;
QUIT;

%let collin_free_inputs=&amp;inputs.;
/*---------------------------------------------------------------------------------------------------------------------------------
--|Step4: Applied code in order to set the new metadata|--
----------------------------------------------------------------------------------------------------------------------------------*/
%LET varlist= &amp;collin_free_inputs.;

%LET varlist=%enquote(&amp;varlist,separator=);
%metadata(newrole=Rejected,where=(NAME not in (&amp;varlist) and upcase(ROLE)='INPUT' and UPCASE(level)='INTERVAL'));
RUN;
/*------------------------------------------------------------------------------
--- Reset sas Parameters
------------------------------------------------------------------------------*/
/*proc printto;
           run;
ods results on;
ods output;
ods html;
ods listing;*/
/*------------------------------------------------------------------------------
--- Set timer parameters
------------------------------------------------------------------------------*/
%Let timeEnd = %Sysfunc(Datetime());
%Let timediff = %Sysfunc(Sum(&amp;&amp;timeend, -&amp;&amp;timestart));
%Let Elapsed =  %Sysfunc(Sum(&amp;timediff), Time8.);
%let Start = %sysfunc(sum(&amp;timestart),datetime16.);
%let End = %sysfunc(sum(&amp;timeend),datetime16.);
/*__________________________________________________________________________________________*/
%put &gt;&gt;&gt;  STATUS: Collinearity Analysis macro terminated  &lt;&lt;&lt;;
%put &gt;&gt;&gt;  PROCESS: &amp;n Variables processed  &lt;&lt;&lt;;
%put &gt;&gt;&gt;  CYCLES: &amp;n Regressions carried out  &lt;&lt;&lt;;
%put &gt;&gt;&gt;  TIME: Started at &amp;Start and terminated at &amp;end   &lt;&lt;&lt;;
%put &gt;&gt;&gt;  ELAPSED: &amp;Elapsed  &lt;&lt;&lt;;

%mend m_collinearity_analysis;


%m_collinearity_analysis(
INPUTS=%EM_INTERVAL_INPUT
,target=%em_BINARY_target
,lib=&amp;em_lib
,ds=&amp;em_import_data
,vif=&amp;vif
,load=&amp;load
,partition_col=
,partition_val=
,mdl=&amp;MDL
,GenerateOutput=&amp;GenerateOutput
,log_printto=&amp;DIR./&amp;datetimestamp._&amp;User._CLL_log_&amp;mdl..log
,output_printto=&amp;DIR./&amp;datetimestamp._&amp;User._CLL_output_&amp;mdl..out
);

%LET DIR=/ebn/warehouse/Modelos/Output_Logs;
%LET MIN_NULL_LVL=0.60;					/*Null percentage cutoff (anything above this number will be rejected)*/
%LET NULL_GROUPING_COLS=PERIODO;		/*For stack ABTs the grouping variable for the analysis is reference period*/
FILENAME NULLCODE &quot;&amp;DIR/NULL_ANALYSIS_CODE_&amp;MDL..SAS&quot;;  /*SAS PROC SQL code that carries out the null analysis by variable*/
FILENAME MNNLCODE &quot;&amp;DIR/MIN_NULL_LEVEL_CODE_&amp;MDL..SAS&quot;; /*SAS PROC SQL code that selects the minimum null level found across all available periods*/
%LET LIB=&amp;EM_LIB.;						/*Default Diagram library*/
%LET MDL=&amp;EM_NODEID.;					/*Use the node ID as identifier for output tables*/
%LET USER=&amp;SYSUSERID;					/*User ID*/
%LET GENERATEOUTPUT=N;					/*N: Don't generate EM output, Y: Generate EM output*/
/*------------------------------------------------------------------------------
  --- Timestamp format for log and output
------------------------------------------------------------------------------*/
%LET DATESTART  	= %SYSFUNC(DATE());
%LET DATESTAMP  	= %SYSFUNC(SUM(&amp;DATESTART),YYMMDDN8.);
%LET TIMESTART  	= %SYSFUNC(TIME());
%LET TIMESTAMP  	= %STR(%SYSFUNC(SUM(&amp;TIMESTART),TIME8.0));
%LET TIMESTAMP2 	= %SYSFUNC(TRANWRD(&amp;TIMESTAMP,:,));
%LET TIMESTAMP3 	= %SYSFUNC(COMPRESS(&amp;TIMESTAMP2));
%LET DATETIMESTAMP 	= &amp;DATESTAMP._&amp;TIMESTAMP3;

OPTIONS SYMBOLGEN MPRINT MLOGIC;

%MACRO M_NLAD(
 DSNAME=
,DEPENDENT=
,VARIABLES=
,NULL_GROUPING_COLS=
,LIB=
,PARTITION_COL=
,PARTITION_VAL=
,MDL=
,GENERATEOUTPUT=
,LOG_PRINTTO=
,OUTPUT_PRINTTO=
)
;
	%LET TIMESTART = %SYSFUNC(DATETIME());
	/*------------------------------------------------------------------------------
  	--- Start opt sas Parameters
  	------------------------------------------------------------------------------*/
	DM LOG &quot;CLEAR&quot; CONTINUE;/*CLEAR CURRENT LOG*/
	DM 'ODSRESULTS' CLEAR;/*CLEAR CURRENT RESULTS*/
	%IF %UPCASE(&amp;GENERATEOUTPUT)=N %THEN
	     %DO;
	           /*OPTIONS NOSYMBOLGEN NOMPRINT NOMLOGIC;*//*SET NO CODE DEBUGGING*/

	           PROC PRINTTO
	                FILE=&quot;&amp;OUTPUT_PRINTTO.&quot;
	                LOG=&quot;&amp;LOG_PRINTTO.&quot;
	                NEW;
	           RUN;

	           ODS RESULTS OFF;
	           ODS OUTPUT CLOSE;
	           ODS HTML CLOSE; 
	           /*ODS LISTING CLOSE;*/
	     %END;
	/*------------------------------------------------------------------------------
  	--- Define Parameters
  	------------------------------------------------------------------------------*/
	%LET VDATA=&amp;DSNAME.;
	%LET VVARIABLE_NAMES=&amp;VARIABLES.;
	%LET VVARIABLE_NAMES_ENQ=%ENQUOTE(&amp;VARIABLES.,SEPARATOR=);
	%LET VNULL_GRP_COLS=&amp;NULL_GROUPING_COLS.;
	%LET VLIB=&amp;LIB.;
	%LET VPART_COL=&amp;PARTITION_COL.;
	%LET VPART_VAL=&amp;PARTITION_VAL.;
	%LET N_VARS=%SYSFUNC(COUNTW(&amp;VVARIABLE_NAMES.));
	%LET N=0;
	/*---------------------------------------------------------------------------------------------------
	--|Create table with all columns' names
	---------------------------------------------------------------------------------------------------*/
	 PROC CONTENTS
       DATA=&amp;EM_IMPORT_DATA.
       OUT=&amp;EM_LIB..VARIABLES_NAMES_&amp;MDL.;
	RUN;
 	/*---------------------------------------------------------------------------------------------------
	--|Create table with only inputs names
	---------------------------------------------------------------------------------------------------*/
	%LET VVARIABLE_NAMES_ENQ=%ENQUOTE(&amp;VVARIABLE_NAMES.,SEPARATOR=);
	PROC SQL;
	     CREATE TABLE &amp;EM_LIB..VARIABLES_INPUTS_&amp;MDL.
	     AS
	     SELECT
	     DISTINCT NAME
	     FROM &amp;EM_LIB..VARIABLES_NAMES_&amp;MDL.
	     WHERE NAME IN (&amp;VVARIABLE_NAMES_ENQ.)
	     ;
	QUIT;
 	/*---------------------------------------------------------------------------------------------------
	--|Generate the Null level analysis code
	---------------------------------------------------------------------------------------------------*/	
 	DATA _NULL_;
		FILE NULLCODE;
		SET &amp;EM_LIB..VARIABLES_INPUTS_&amp;MDL. END=LAST;
		IF _N_=1 THEN DO;
			PUT &quot;PROC SQL;&quot;;
			PUT &quot;	CREATE TABLE &amp;EM_LIB..NULL_ANALYSIS_&amp;MDL.&quot;;
			PUT &quot;	AS&quot;;
			PUT &quot;	SELECT&quot;;
			PUT &quot;	&amp;VNull_Grp_Cols.&quot;;
		END;
		IF NOT LAST THEN DO;
			PUT &quot;	,	AVG(IFN(&quot; NAME &quot; IS MISSING,1,0)) AS &quot; NAME;
		END;
		ELSE IF LAST THEN DO;
			PUT &quot;	FROM &amp;EM_IMPORT_DATA.&quot;;
			PUT &quot;	GROUP BY &quot;;
			PUT &quot;	&amp;VNull_Grp_Cols.&quot;;
			PUT &quot;	ORDER BY&quot;;
			PUT &quot;	&amp;VNull_Grp_Cols.;&quot;;
			PUT &quot;QUIT;&quot;;
		END;
	RUN;
 	/*---------------------------------------------------------------------------------------------------
	--|Invoke and execute the null analysis code and create Null summary table
	---------------------------------------------------------------------------------------------------*/
	%INCLUDE NULLCODE/SOURCE;
  	/*---------------------------------------------------------------------------------------------------
	--|Generate Minimum Null level analysis code
	---------------------------------------------------------------------------------------------------*/
 	DATA _NULL_;
		FILE MNNLCODE;
		SET &amp;EM_LIB..VARIABLES_INPUTS_&amp;MDL. END=LAST;
		IF _N_=1 THEN DO;
			PUT &quot;PROC SQL;&quot;;
			PUT &quot;	CREATE TABLE &amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL.&quot;;
			PUT &quot;	AS&quot;;
			PUT &quot;	SELECT&quot;;
			PUT '	&quot;MIN_NULL_LEVEL&quot; AS SUMMARY';
		END;
		IF NOT LAST THEN DO;
			PUT &quot;	,	MIN(&quot; NAME &quot;) AS &quot; NAME;
		END;
		ELSE IF LAST THEN DO;
			PUT &quot;	FROM &amp;EM_LIB..NULL_ANALYSIS_&amp;MDL.&quot;;
			PUT &quot;QUIT;&quot;;
		END;
	RUN;
  	/*---------------------------------------------------------------------------------------------------
	--|invoke and execute the Minimum Null level analysis code
	---------------------------------------------------------------------------------------------------*/
	%INCLUDE MNNLCODE/SOURCE;
  	/*---------------------------------------------------------------------------------------------------
	--|Transpose the Minimum Null Level table for further filtering
	---------------------------------------------------------------------------------------------------*/
     PROC TRANSPOSE
       DATA=&amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL.  (DROP=SUMMARY)
       OUT=&amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL._T (DROP=_LABEL_)
       NAME=VARIABLE_NAME
	     PREFIX=MIN_NULL_LEVEL
     		;
     	VAR _ALL_;
     run;
  	/*---------------------------------------------------------------------------------------------------
	--|Generate reports with the results from the Null analysis
	---------------------------------------------------------------------------------------------------*/
		title1 &quot;Variables to be rejected due to high null levels&quot; font='arial/bo' justify=left;
		PROC SQL;
			SELECT 
			VARIABLE_NAME
			FROM &amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL._T 
			WHERE MIN_NULL_LEVEL1&gt;=&amp;MIN_NULL_LVL.
			;
		QUIT;	

		title1 &quot;Variables to be included due to low null levels&quot; font='arial/bo' justify=left;
		PROC SQL;
			SELECT 
			VARIABLE_NAME
			FROM &amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL._T 
			WHERE MIN_NULL_LEVEL1&lt;&amp;MIN_NULL_LVL.
			;
		QUIT;	
	/*---------------------------------------------------------------------------------------------------
	--|Create catalog table with the list of variables to be rejected
	---------------------------------------------------------------------------------------------------*/
	DATA &amp;EM_LIB..HIGH_NULL_LEVEL_VARS_&amp;MDL.;
		SET &amp;EM_LIB..MIN_NULL_LEVEL_&amp;MDL._T  (WHERE=(MIN_NULL_LEVEL1&gt;=&amp;MIN_NULL_LVL.));
		COUNTER=_N_;
	RUN;
	/*---------------------------------------------------------------------------------------------------
	--|Get total number of variables to be rejected
	---------------------------------------------------------------------------------------------------*/
	PROC SQL; SELECT COUNT(1) INTO :N FROM &amp;EM_LIB..HIGH_NULL_LEVEL_VARS_&amp;MDL.; QUIT;
	/*---------------------------------------------------------------------------------------------------
	--|Reject variables via loop, using the metadata macro
	---------------------------------------------------------------------------------------------------*/
	%IF &amp;N.&gt;0 %THEN
		%DO; 
			%METADATA();
			%DO I=1 %TO &amp;N. %BY 1;
				%LET HIGH_NULL_LVL_VAR=;
				PROC SQL NOPRINT; SELECT VARIABLE_NAME INTO :HIGH_NULL_LVL_VAR FROM &amp;EM_LIB..HIGH_NULL_LEVEL_VARS_&amp;MDL. WHERE COUNTER=&amp;I.; QUIT;
				%LET VAR=%ENQUOTE(&amp;HIGH_NULL_LVL_VAR.,SEPARATOR=);
				%METADATA(NEWROLE=REJECTED,APPEND=Y,WHERE=(NAME IN (&amp;VAR.) AND UPCASE(ROLE)='INPUT'));
			%END; 
		%END; 
	/*------------------------------------------------------------------------------
	--- Reset sas Parameters
	------------------------------------------------------------------------------*/
	/*PROC PRINTTO;
	           RUN;
	ODS RESULTS ON;
	ODS OUTPUT;
	ODS HTML;
	ODS LISTING;*/
	/*------------------------------------------------------------------------------
	--- Set timer parameters
	------------------------------------------------------------------------------*/
	%LET TIMEEND = %SYSFUNC(DATETIME());
	%LET TIMEDIFF = %SYSFUNC(SUM(&amp;&amp;TIMEEND, -&amp;&amp;TIMESTART));
	%LET ELAPSED =  %SYSFUNC(SUM(&amp;TIMEDIFF), TIME8.);
	%LET START = %SYSFUNC(SUM(&amp;TIMESTART),DATETIME16.);
	%LET END = %SYSFUNC(SUM(&amp;TIMEEND),DATETIME16.);
	/*__________________________________________________________________________________________*/
	%PUT &gt;&gt;&gt;  STATUS: Null Analysis terminated  &lt;&lt;&lt;;
	%PUT &gt;&gt;&gt;  PROCESS: &amp;n. Variables rejected  &lt;&lt;&lt;;
	%PUT &gt;&gt;&gt;  TIME: Started at &amp;Start. and terminated at &amp;end.   &lt;&lt;&lt;;
	%PUT &gt;&gt;&gt;  ELAPSED: &amp;Elapsed.  &lt;&lt;&lt;;
 %MEND M_NLAD;


%M_NLAD
(
DSNAME=&amp;EM_IMPORT_DATA.
,DEPENDENT=%EM_BINARY_TARGET
,VARIABLES= %EM_INTERVAL_INPUT
,NULL_GROUPING_COLS=&amp;NULL_GROUPING_COLS.
,LIB=&amp;LIB
,PARTITION_COL=
,PARTITION_VAL=
,MDL=&amp;MDL.
,GENERATEOUTPUT=&amp;GENERATEOUTPUT.
,LOG_PRINTTO=&amp;DIR./&amp;DATETIMESTAMP._&amp;USER._NLAD_log_&amp;MDL..LOG
,OUTPUT_PRINTTO=&amp;DIR./&amp;DATETIMESTAMP._&amp;USER._NLAD_output_&amp;MDL..OUT
)
;

PROC CONTENTS
           	DATA=&amp;EM_IMPORT_DATA.
           	OUT=VARIABLES_NAMES
			NOPRINT;
RUN;

