   SELECT
   DISTINCT NAME
	INTO
	:GROUP_VARIABLES SEPARATED BY &quot; &quot;
   FROM VARIABLES_NAMES
   WHERE NAME LIKE &quot;GRP_%&quot;
     ;
QUIT;

%LET VARLIST=&amp;GROUP_VARIABLES.;

%LET VARLIST=%ENQUOTE(&amp;VARLIST.,SEPARATOR=);
%METADATA(NEWROLE=REJECTED,WHERE=(NAME IN (&amp;VARLIST.) AND UPCASE(ROLE)='INPUT'));

